The Apico 2-Stroke Festival Featuring Red Bull Pro Stroke National…. 🎶 #SummerIncoming 

Bring you the summer vibes that we’ve all been waiting for! 

Last years atmosphere was absolutely insane so let’s top that in 2023… Fans we’ll have food, music, 2-strokes, youth and pros we’ve also got awesome prizes to give away. What more can you ask for!? 

We’ve got some amazing sponsors that have come on board to provide some of the best giveaways yet.  Plus prize money for those of you that work extra hard to prove your skills. 

The UK Movement Festival is all about bringing everyone together and having fun. Whether you’re an experienced pro or just starting out, we’ll have something for everyone! 

What’s more, we’ve got areas dedicated to the best new emerging talent in the UK. Along with seasoned professionals, we’re giving up and coming stars a platform to show off their skills to industry leaders. We want to be your gateway to success! 

So get involved in the UK Movement and come down to the festival! We can’t wait to see you here and make sure you bring your friends and family along too! Let’s make this an unforgettable summer.

Make sure you mark your calendar for 22-23 July, and join us for the Apico 2-Stroke Festival featuring the Red Bull Pro Stroke National.

