The Apico 2-Stroke Festival featuring Red Bull Pro Stroke National. 

We’re excited to announce our biggest rider give-back event yet in 2024. 

Dave Willet and Dylan Brown have agreed to a 15-thousand-pound deal, at next year’s Festival. 
The collaboration will open up the taps to the brands Apico look after to bring the more opportunities to the riders and classes. It’s set to be the most exciting event and provide plenty of fun. From the biggest pro riders to a variety of activities and classes, there’s something for everyone. 

Dave Willet - since my first event one of my main focuses has been to give the support back to those which have support the event. After opening the event up to more riders and classes at short notice last year I quickly realised I need to try and give back to more riders - Dylan and Anna have been brilliant over the years and recognised I need more support for the event size now. 

Dylan - 

Anna and I absolutely love coming to the festival each year. Seeing all the riders and spectators enjoying themselves and the positive energy that comes with it is really inspiring - we feel it's the best event to give back to the motocross community. It gives us great pleasure to increase the level of support 

